import { css } from "styled-components";

export const ValignTextBottom = css`
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
`;

export const RobotoLightBlack22px = css`
  color: var(--black);
  font-family: var(--font-family-roboto);
  font-size: var(--font-size-xxs);
  font-weight: 300;
  font-style: normal;
`;

export const BarlowNormalEerieBlack18px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-barlow);
  font-size: var(--font-size-xxxs);
  font-weight: 400;
  font-style: normal;
`;

export const RobotoLightTurquoisePearl14px = css`
  color: var(--turquoise-pearl);
  font-family: var(--font-family-roboto);
  font-size: 14px;
  font-weight: 300;
  font-style: normal;
`;

export const InterNormalEerieBlack24px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-inter);
  font-size: 24px;
  font-weight: 400;
  font-style: normal;
`;

export const InterNormalBlack18px = css`
  color: var(--black);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxxs);
  font-weight: 400;
  font-style: normal;
`;

export const InterNormalEerieBlack18px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxxs);
  font-weight: 400;
  font-style: normal;
`;

export const NobileBoldEerieBlack48px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-nobile);
  font-size: var(--font-size-l);
  font-weight: 700;
  font-style: normal;
`;

export const InterNormalEerieBlack16px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-inter);
  font-size: 16px;
  font-weight: 400;
  font-style: normal;
`;

export const NobileNormalEerieBlack66px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-nobile);
  font-size: var(--font-size-xl);
  font-weight: 400;
  font-style: normal;
`;

export const AlataNormalEerieBlack27px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-alata);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const NobileBoldEerieBlack27px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-nobile);
  font-size: var(--font-size-m);
  font-weight: 700;
  font-style: normal;
`;

export const InterNormalAlto18px = css`
  color: var(--alto);
  font-family: var(--font-family-inter);
  font-size: var(--font-size-xxxs);
  font-weight: 400;
  font-style: normal;
`;

export const RobotoLightBlack25px = css`
  color: var(--black);
  font-family: var(--font-family-roboto);
  font-size: var(--font-size-xs);
  font-weight: 300;
  font-style: normal;
`;

export const AcmeNormalWhite50px = css`
  color: var(--white);
  font-family: var(--font-family-acme);
  font-size: 50px;
  font-weight: 400;
  font-style: normal;
`;

export const AdobeblankRegularNormalWhite25px = css`
  color: var(--white);
  font-family: var(--font-family-adobe_blank-regular);
  font-size: var(--font-size-xs);
  font-weight: 400;
  font-style: normal;
`;

export const RobotoMediumPictonBlue22px = css`
  color: var(--picton-blue);
  font-family: var(--font-family-roboto);
  font-size: var(--font-size-xxs);
  font-weight: 500;
  font-style: normal;
`;

export const RobotoLightWhite22px = css`
  color: var(--white);
  font-family: var(--font-family-roboto);
  font-size: var(--font-size-xxs);
  font-weight: 300;
  font-style: normal;
`;

export const OffsideNormalWhite26px = css`
  color: var(--white);
  font-family: var(--font-family-offside);
  font-size: var(--font-size-s);
  font-weight: 400;
  font-style: normal;
`;

export const Border1pxBlack = css`
  border: 1px solid var(--black);
`;

export const Border1pxBlack2 = css`
  border: 1px solid var(--black-2);
`;
